        }
    }

    render() {
        return (
            <section>
                <ul>
                    <li>Categorias</li>
                    <li>Categorias</li>
                    <li>Categorias</li>
                </ul>
                <input type="text" 
                placeholder="Adicionar Categoria"
                onKeyUp={this.__HandleEventoInput.bind(this)}
                />
            </section>
        );
    }
}

